(518,	'_transient_dash_c05853b002c443ec8e57ff884f56cdde',	'<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://es.wordpress.org/2017/04/03/eventos-wordpress-para-la-semana-14-17/\'>Eventos para la semana</a> <span class=\"rss-date\">03/04/2017</span><div class=\"rssSummary\">¡Buenos días a todos! Os dejamos el listado de las Meetups para esta semana y también el avance de las organizaciones de las distintas WordCamps. Meetups 04/04 – Chiclana – WordPress Multisitio: Una instalación para gobernarlas a todas. 06/04 – Madrid – Aprovechando Slack para tus Notificaciones de WordPress 06/04 – Alicante – Gestión de imágenes en WordPress 06/04 [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://heropress.com/heropress-geography-middle-east/\'>HeroPress: HeroPress Geography: The Middle East</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/wordpress-community-support-shuts-down-wordcamp-netherlands-in-favor-of-city-based-wordcamps\'>WPTavern: WordPress Community Support Shuts Down WordCamp Netherlands in Favor of City-Based WordCamps</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/wordpress-plugin-directory-redesign-why-so-many-people-feel-their-feedback-was-ignored\'>WPTavern: WordPress Plugin Directory Redesign: Why So Many People Feel Their Feedback Was Ignored</a></li></ul></div><div class=\"rss-widget\"><ul></ul></div>',	'no'),
