(4,	1,	'2017-03-02 17:04:34',	'2017-03-02 17:04:34',	'Lorenzo Constans G., Presidente de Mutual de Seguridad CChC, le saluda cordialmente y tiene el agrado de invitarte a la inauguración del Centro de Cultura de Seguridad Vial.\r\n\r\nEl Centro de Cultura de Seguridad Vial surge como un innovador espacio de experiencias, para contribuir a la prevención de accidentes en el espacio público y a un desplazamiento seguro por la ciudad, con foco en todos los actores que interactúan, sean estos peatones, ciclistas, motociclistas,automovilistas y conductores de transporte público e interurbano, además de la participación conjunta de la comunidad, empresas, instituciones gubernamentales, academia y actores relevantes.',	'INAUGURACIÓN CENTRO DE CULTURA DE SEGURIDAD VIAL',	'',	'publish',	'closed',	'closed',	'',	'inauguracion-centro-de-cultura-de-seguridad-vial',	'',	'',	'2017-04-03 19:12:38',	'2017-04-03 19:12:38',	'',	0,	'http://localhost/mutual-eventos-publicos/?post_type=eventos&#038;p=4',	0,	'eventos',	'',	0),
