(112,	1,	'2017-03-13 20:59:50',	'2017-03-13 20:59:50',	'Lorenzo Constans G., Presidente de Mutual de Seguridad CChC, le saluda cordialmente y tiene el agrado de invitarte a la inauguración del Centro de Cultura de Seguridad Vial.\r\n\r\nEl Centro de Cultura de Seguridad Vial surge como un innovador espacio de experiencias, para contribuir a la prevención de accidentes en el espacio público y a un desplazamiento seguro por la ciudad, con foco en todos los actores que interactúan, sean estos peatones, ciclistas, motociclistas,automovilistas y conductores de transporte público e interurbano, además de la participación conjunta de la comunidad, empresas, instituciones gubernamentales, academia y actores relevantes.',	'Inauguración Centro de Cultura de Seguridad Vial',	'Lorem ipsum dolor sit amet, consectetur adipiscing elit. ',	'inherit',	'closed',	'closed',	'',	'4-revision-v1',	'',	'',	'2017-03-13 20:59:50',	'2017-03-13 20:59:50',	'',	4,	'http://localhost/mutual-eventos-publicos/4-revision-v1/',	0,	'revision',	'',	0),
